import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import { Menu, MenuButton, MenuItems } from '@headlessui/react'
import { ChevronDownIcon } from '@heroicons/react/20/solid'
import { useState } from 'react';

interface CategoryCounts {
    scope: number;
    software: number;
    payment: number;
    dataSec: number;
    sla: number;
    own: number;
    contractDuration: number;
    exit: number;
    legal: number;
    compliance: number;
    cost: number;
  }

  interface aiResults {
    Compliance1: string;
    Exit1: string;
    Cost1: string;
    Sla1: string;
    Exit2: string;
    Cost2: string;
    ContractDuration1: string;
    Payment1: string;
    Compliance2: string;
    Scope1: string;
    DataSec1: string;
    ContractDuration2: string;
    Software1: string;
    Own1: string;
    Sla2: string;
    Scope2: string;
    DataSec2: string;
    Legal1: string;
    Legal2: string;
    Own2: string;
    Payment2: string;
    Software2: string;
  }

interface NavbarProps {
    avgScore: number;
    tick: number;
    cross: number;
    question: number;
    aiResults: aiResults;
    counts: CategoryCounts;
    CountCat: CountCat;
}

interface CountCat {
    tick: number;
    cross: number;
    question: number;
}

function Sidebar({
    avgScore,
    CountCat,
    aiResults,
    counts,
}: NavbarProps) {


    //Values for Classes, Circular Progressbar




    let tickValue = 0;
    if (CountCat.tick) {
        tickValue = CountCat.tick;
    }
    let crossValue = 0;
    if (CountCat.cross) {
        crossValue = CountCat.cross;
    }

    let questionValue = 0;
    if (CountCat.question) {
        questionValue = CountCat.question;
    }

    let value = 0;
    if (avgScore) {
        value = avgScore;
    } 


    //State for Infobutton

    const [info, hoverInfo] = useState(false);

    const InfoBox = async () => {
        hoverInfo((state) => !state);
    }



    return (
        <>

        {/* Sidebar */}
        <div className="flex justify-center w-96 bg-white h-full">
            <div className="flex flex-col">
                <div className="flex justify-center">
